  input: '"TEXT","F3XA","C00033134","In response to the July 26, 2006 letter from
    the Reports Analysis Division of the Federal Election Committee, and pursuant
    to the conversation between Ms. Rosa Lewis of the FEC Reports Analysis Division
    and Party legal counsel on 8/28/2006, the Colorado Republican Party has determined
    that a contribution in excess of the limits was inadvertently made to the Bilbray
    for Congress Committee, a federal candidate committee, from the Colorado Republican
    Federal Campaign Committee, FEC ID C00033134.  The Colorado Republican Party,
    acting through its legal counsel, has contacted representatives for the Bilbray
    for Congress Committee, has informed them of the error, and has requested a return
    of excess contribution check in the amount of $5,000.00.  Once the return of contribution
    check has been received, the Colorado Republican Federal Campaign Committee will
    file all appropriate amendments to its June 2006 monthly report, and will send
    a copy of the check received and a copy of the amended reports to the attention
    of Ms. Lewis of the  FEC Reports Analysis Division.  In addition, the totals listed
    on Lines 21(b), 21(c), 30(b) and 30(b), Column B of the Detailed Summary Page,
    and the proper disclosures for salary and wages of employees who spend more than
    25 percent of their time on federal election activity on Schedule B for Line 30(b)
    of the Detailed Summary Page will be properly disclosed on appropriate amendments
    to the June 2006 monthly report."'
